import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import "./index.css";
import data from "./data";
// import App from "./App";
// import { Add, Divide, Mod, Mul, Sub } from "./Clc";

ReactDOM.render(
  <>
    <h1 className="d-block text-center fs-4">Web Series</h1>
    <div className="cards container justify-content-between align-items-center">
      <Card
        imgsrc={data[0].imgsrc}
        title={data[0].title}
        sn={data[0].sn}
        link={data[0].link}
      />
      <Card
        imgsrc={data[1].imgsrc}
        title={data[1].title}
        sn={data[1].sn}
        link={data[1].link}
      />
      <Card
        imgsrc={data[2].imgsrc}
        title={data[2].title}
        sn={data[2].sn}
        link={data[2].link}
      />
      <Card
        imgsrc={data[2].imgsrc}
        title={data[2].title}
        sn={data[2].sn}
        link={data[2].link}
      />
    </div>
  </>,
  document.getElementById("root")
);
